import{_ as e}from"./chunks/log_download.BSfsCXzz.js";import{_ as t,c as a,o as r,ab as o}from"./chunks/framework.CUflZczI.js";const u=JSON.parse('{"title":"Політні звіти","description":"","frontmatter":{},"headers":[],"relativePath":"uk/getting_started/flight_reporting.md","filePath":"uk/getting_started/flight_reporting.md"}'),l={name:"uk/getting_started/flight_reporting.md"},i=o('<h1 id="політні-звіти" tabindex="-1">Політні звіти <a class="header-anchor" href="#політні-звіти" aria-label="Permalink to &quot;Політні звіти&quot;">​</a></h1><p>PX4 реєструє детальний стан апарату і дані датчиків, які можна використовувати для аналізу проблем з продуктивністю. У цій темі пояснюється, як ви можете завантажувати та аналізувати бортові журнали, а також ділитися ними з командою розробників.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>У деяких юрисдикціях ведення бортових журналів є законодавчою вимогою.</p></div><h2 id="завантаження-журналів-з-політного-контролера" tabindex="-1">Завантаження журналів з політного контролера <a class="header-anchor" href="#завантаження-журналів-з-політного-контролера" aria-label="Permalink to &quot;Завантаження журналів з політного контролера&quot;">​</a></h2><p>Журнали можна завантажити за допомогою <a href="http://qgroundcontrol.com/" target="_blank" rel="noreferrer">QGroundControl</a>: <strong><a href="https://docs.qgroundcontrol.com/master/en/analyze_view/log_download.html" target="_blank" rel="noreferrer">Analyze View &gt; Log Download</a></strong>.</p><p><img src="'+e+'" alt="Завантаження журналу польоту"></p><h2 id="аналіз-журналів" tabindex="-1">Аналіз журналів <a class="header-anchor" href="#аналіз-журналів" aria-label="Permalink to &quot;Аналіз журналів&quot;">​</a></h2><p>Завантажте файл журналу в онлайн-інструмент <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a>. Після завантаження вам буде надіслано посилання на сторінку аналізу журналу.</p><p><a href="./../log/flight_review.html">Аналіз журналів за допомогою Flight Review</a> пояснює, як інтерпретувати графіки, і може допомогти вам перевірити/відхилити причини поширених проблем: надмірна вібрація, погане налаштування PID, перенасичені контролери, незбалансовані рухомі засоби, шуми GPS тощо.</p><div class="info custom-block"><p class="custom-block-title">Є багато інших чудових інструментів для візуалізації та аналізу журналів PX4. Для отримання додаткової інформації: <a href="./../dev_log/flight_log_analysis.html">Аналіз польоту</a>.</p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Якщо у вас є постійне високошвидкісне з&#39;єднання MAVLink з апаратом (а не тільки телеметричне з&#39;єднання), ви можете використовувати <em>QGroundControl</em> для автоматичного завантаження журналів безпосередньо в <em>Flight Review</em>. Для отримання додаткової інформації див. <a href="https://docs.qgroundcontrol.com/master/en/SettingsView/MAVLink.html#logging" target="_blank" rel="noreferrer">Налаштування &gt; Налаштування MAVLink &gt; Ведення журналу MAVLink 2 (тільки PX4)</a>.</p></div><h2 id="надання-доступу-до-фаилів-журналів-розробникам-px4" tabindex="-1">Надання доступу до файлів журналів розробникам PX4 <a class="header-anchor" href="#надання-доступу-до-фаилів-журналів-розробникам-px4" aria-label="Permalink to &quot;Надання доступу до файлів журналів розробникам PX4&quot;">​</a></h2><p>Посилання на файл журналу у <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a> можна надати для обговорення на <a href="./../contribute/support.html#forums-and-chat">форумах підтримки</a> або в <a href="./../README.html#reporting-bugs-issues">Github issue</a>.</p><h2 id="конфігурація-журналу" tabindex="-1">Конфігурація журналу <a class="header-anchor" href="#конфігурація-журналу" aria-label="Permalink to &quot;Конфігурація журналу&quot;">​</a></h2><p>За замовчуванням систему логування налаштовано на збір значущих записів для використання у <a href="http://logs.px4.io" target="_blank" rel="noreferrer">Flight Review</a>.</p><p>Логування можна додатково налаштувати за допомогою параметрів <a href="./../advanced_config/parameter_reference.html#sd-logging">SD Logging</a> або за допомогою файлу на SD-карті. Докладні відомості про конфігурацію можна знайти у <a href="./../dev_log/logging.html#configuration">документації з конфігурування логування</a>.</p><h2 id="ключові-посилання" tabindex="-1">Ключові посилання <a class="header-anchor" href="#ключові-посилання" aria-label="Permalink to &quot;Ключові посилання&quot;">​</a></h2><ul><li><a href="http://logs.px4.io" target="_blank" rel="noreferrer">Огляд польоту</a></li><li><a href="./../log/flight_review.html">Аналіз журналів за допомогою Flight Review</a></li><li><a href="./../dev_log/flight_log_analysis.html">Аналіз журналу польотів</a></li></ul>',18),n=[i];function h(s,g,c,p,d,_){return r(),a("div",null,n)}const b=t(l,[["render",h]]);export{u as __pageData,b as default};
